export const imageTypes = {
  RAW: "raw",
  FULL: "full",
  REGULAR: "regular",
  SMALL: "small",
  THUMB: "thumb"
};

export const getImageUrls = (images, type) => {
  return images.map(imageObject => {
    return imageObject.urls[type];
  })
}
